import React, { Component } from 'react';

class WishMessage extends Component{
  constructor(){
      super();
      this.state ={
          message:'Choose color from below given option.',
          color:['RED','YELLOW','BLUE','GREEN']
      }
  }

    render(){
        return(
            <div>
             {this.state.message}
             <li>{this.state.color[0]}</li>
             <li>{this.state.color[1]}</li>
             <li>{this.state.color[2]}</li>
             <li>{this.state.color[3]}</li>
            </div>

        );
    }
}

export default WishMessage;
